import React from "react";
import { ChevronsDown } from "react-feather";
import { Box, Button, Text } from "bumbag";

const ScrollDown = () => (
  <Box display="flex">
    <Button
      borderRadius="7"
      border="none"
      altitude="300"
      width={{ default: "3.5rem", 'max-tablet': '2.5rem' }}
      height={{ default: "3.5rem", 'max-tablet': '2.5rem' }}
      display="flex"
    >
      <ChevronsDown 
      width={{ default: "rem", 'max-tablet': '1rem' }} />
    </Button>
    <Text alignSelf="center" paddingLeft="1rem">
      Scroll Down
    </Text>
  </Box>
)

export default ScrollDown
